import axios from "axios";

const apiEndpoint= "localhost:8080/login";

export function login(email,password)
{
     axios.post(apiEndpoint,{email,password}).then(function (response) {
        console.log(response);
      })
      .catch(function (error) {
        console.log(error);
      });
}
